The Italian dish that everyone will love!

INGREDIENTS
 150g (1 cup) 00 flour;
 1 egg;
 2 egg yolks;
 a pinch of salt;
 200g (1 cup) ricotta;
 1 egg;
 180g (6 cups) fresh spinach;
 1 garlic clove, crushed;
 Olive oil;
 60g (½ cup) parmesan cheese;
 a pinch of nutmeg.

METHOD
 Knead the flour with 1 egg, 2 egg yolks and salt. Cover the dough and set aside for 30 minutes.
 Brown crushed garlic in olive oil, remove the garlic clove and use garlic oil to wilt all the spinach.
 Squeeze excess liquid from the spinach and chop it.
 Combine chopped spinach with ricotta, salt, pepper, nutmeg, egg and parmesan.
 Cut the pasta dough in half and roll each half out.
 Pipe ricotta filling forming a ring, place 1 egg yolk in the middle of the ring, then cover with another sheet of pasta dough and close, removing any excess air.
 Cut out giant ravioli and boil until they float. Serve with melted butter, parmesan and black pepper.

