Stuffed #olives: the traditional Italian recipe for a tasty appetizer!

INGREDIENTS
200g beef;
½ onion, chopped;
1 celery stalk, chopped;
80g parmesan;
30g breadcrumbs;
120ml chicken stock;
Olives;

Flour, breadcrumbs, eggs.
METHOD
Cut the pit out from the olives as shown on the video.
Heat some olive oil over medium heat and saute onions and celery. Add sliced beef and cook for 5 minutes, then pour in some stock and cook down for 10 minutes more.
Blend beef adding parmesan and breadcrumbs until smooth.
Fill each olive with beef mixture, then dredge in flour, cover in egg and breadcrumbs.
Fry until golden and serve right away.

